import { useParams } from "react-router-dom";
import React, { useState, useContext, useEffect } from "react";
import axios from "axios";
import "./style.css";
import { useNavigate } from "react-router-dom";



 const MovieInfo = () => {
 
  const navigate = useNavigate();
  const [info, setInfo] = useState([]);
  let { id } = useParams();

 

  ////////////////////////////////
//getMoviebyId
  const getDoctorbyId = () => {
    axios
      .get(`http://localhost:5000/doctors/getdectors/${id}`, {
        headers: {
          authorization: `Bearer ${token}`,
        },
      })
      .then((result) => {
        setInfo(result.data.doctors[0]);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  useEffect(() => {
    getDoctorbyId();
  }, []);

  ////////////////////////////*/////////////////

  const getappointment = () => {
    axios
      .get(`http://localhost:5000/doctors/appointments`, {
        headers: {
          authorization: `Bearer ${token}`,
        },
      })
      .then((res) => {
        console.log(res.data);

        setAppointment(res.data.appointments);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    getappointment();
  }, []);

  ////////////////////////////////

  const getavappointment = () => {
    axios
      .get(`http://localhost:5000/doctors/appointmentsUser`, {
        headers: {
          authorization: `Bearer ${token}`,
        },
      })
      .then((res) => {
        // console.log(res.data);

        setAppointment(res.data.appointments);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    getavappointment();
  }, []);

  /////////////////////////////////
  /*   setToken(localStorage.getItem("token")); */

  const creatNewAppointment = () => {
    axios
      .post(
        "http://localhost:5000/doctors/appointments/",
        {
          availableDate,
          isBooked,
        },
        {
          headers: {
            authorization: `Bearer ${token}`,
          },
        }
      )

      .then((result) => {
        // console.log(result.data);
        setMessage(result.data.message);
      })
      .catch((err) => {
        //  console.log(err.response.data.message);
        setMessage(err.response.data.message);
      });
  };

  ////////////////////////////
  const book = (id) => {
    axios
      .post(
        `http://localhost:5000/doctors/appointment/${id}`,

        {
          isBooked: false,
        },
        {
          headers: {
            authorization: `Bearer ${token}`,
          },
        }
      )
      .then((result) => {
        //console.log(result.data);
        DoctorInfo();
        setMessage(result.data.message);
      })
      .catch((err) => {
        console.log(err.response.data.message);
        setMessage(err.response.data.message);
      });
  };

  //////////////////////////

  return (
    <div className="contDiv">
      <div>
        <img src={info.img} className="docinfoImg" />
      </div>
     
      <div className="allDet">
        <p className="ifo">firstName: {info.firstName}</p>

        <p  className="ifo">lastName: {info.lastName}</p>
        <p id="des" className="ifo">description: {info.description}</p>

        <p  className="ifo">category: {info.category}</p>
      </div>

      {/*       <Example /> */}

      <div className="addart">
        <p> createAppointment</p>

        <input
          type={"date"}
          placeholder={"avilabledate"}
          onChange={(e) => {
            setAvailableDate(e.target.value);
            console.log(e.target.value);
          }}
        />
        <br />
        <select
          placeholder={"IsBooked"}
          onChange={(e) => {
            setIsBooked(e.target.value);
          }}
        >
          Booked
          <option value="Select availabilty"></option>
          <option value="true">True</option>
          <option value="false">False</option>
        </select>

        <br />

        <button onClick={creatNewAppointment}>Create New appointment</button>
        <h2 className="msg">{message}</h2>

        {appointment &&
          appointment.map((elemnt, index) => {
            return (
              <div className="booking" key={index}>
                <div className="boo"> availabilty:{elemnt.availableDate}</div>
                <div  className="boo">isBooked :{`${elemnt.isBooked}`}</div>
                <br></br>
                <button
                  onClick={(e) => {
                    console.log(elemnt);
                    book(elemnt._id);
                  }}
                >
                  Book
                </button>
              </div>
            );
          })}
      </div>
      <div className="clickDiv">
        <button
          onClick={() => {
            navigate(-1);
          }}
        >
          Back
        </button>
      </div>

    </div>
  );
};

export default MovieInfo;
